export const GifGrid = ({category}) => {

    const getGifs = async () => {
        const url = 'https://api.giphy.com/v1/gifs/search?q=Rick+and+morty&limit=10&api_key=tfRgcwv7vxAyL3vMQapLiD0NQw3148nH';
        const resp = await fetch(url);
        const data = await resp.json();

        console.log(data);
    }

    return (
        <>
            <h3>{category}</h3>
        </>
    )
}
